void MSA_READ::set_new(int bg_in_cons_, const char * seq_){
	bg_in_cons = bg_in_cons_;
	if(bg_in_cons < 0)
		bg_in_cons = 0;
	int seq_len = strlen(seq_);
	seq.clear();
	for (int j = 0; j < seq_len; ++j){
		uint8_t c_bit = _nt4_table_256[(uint8_t)seq_[j]];
		seq.emplace_back(c_bit);
	}
	ed_in_cons = bg_in_cons_ + seq.size();
}

void MSA_READ::set_new(int bg_in_cons_, uint8_t * seq_, int str_len){
	bg_in_cons = bg_in_cons_;
	seq.clear();
	for (int j = 0; j < str_len; ++j)
		seq.emplace_back(seq_[j]);
	ed_in_cons = bg_in_cons + seq.size();
}

